import "./App.css";
import CssBaseline from "@material-ui/core/CssBaseline";
import Grid from "@material-ui/core/Grid";
import Paper from "@material-ui/core/Paper";

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Musicious</h1>
        <p>Get the playlist that fits your taste</p>
      </div>
    );
  }
}

export default App;
